Worker description.
Body smaller (HL <
1.14mm
), with abundant erect or semierect hairs. Eyes very small (EL <
0.16mm
). Sculpturing on front of head nearly reaching posterior margin and extending slightly laterally. Dorsum of head with abundant semierect hairs as well as a few erect hairs. Scapes not reaching posterolateral corners ('lobes') of head; with abundant, slightly elevated pubescence and a limited number of erect hairs. Pronotum with characteristic punctate, irregularly rugose sculpture. Anterior section of pronotum with transverse wrinkles and ridges. Mesonotum and dorsum of propodeum with coarse striate-rugose sculpture. Dorsum of propodeum rounded laterally, with slightly rounded angle and numerous erect hairs. Metapleuron smooth and shining anteriorly. In anterior view petiolar node with apex rounded. Erect hairs on hind tibiae short and scattered. Colour from yellowbrown to brown, head from yellow to yellow-brown, antennae, mandibles and legs yellow or yellow-brown.

